CREATE DEFINER=`root`@`localhost` PROCEDURE `lvlemp` ()  NO SQL
WITH RECURSIVE personPath AS (
	SELECT 
		NIPEG empID,
        NAMA empnama,
        NIPEG_UP mgrID,
        KDKRJ,
        0 lvl
	FROM person
    WHERE NIPEG_UP = ""
		UNION ALL
        SELECT
			pe.NIPEG,
			pe.NAMA,
            pe.NIPEG_UP,
            pe.KDKRJ,
            lvl+1
        FROM person pe
         JOIN personPath pp ON pp.empID = pe.NIPEG_UP )
